import './App.css';
import {NavBarC} from "./Navbar/NavBarC";
import {Col, Container, Row} from "react-bootstrap";
import {Menu} from "./Menu/Menu";
import {Schema} from "./Schema/Schema";


function App() {
  return (
    <div className="App">
      <NavBarC/>
        <Container fluid>
            <Row style={{height:''}}>
                <Col sm={1}>мини меню</Col>
                <Col sm={2}><Menu/></Col>
                <Col sm={9}><Schema/></Col>
            </Row>
            <Row>
                <Col sm={1}>мини меню</Col>
                <Col sm={2}>2</Col>
                <Col sm={9}>
                    <Row>табл</Row>
                    <Row>график</Row>
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default App;
